import React from 'react'
import "./Home.css"
import storeimg from './images/Home-images/storeimg.png'


function Home() {
    return (
        <div className="home">
            <div classname="home_container">
                <img className="home_image" src={storeimg} alt=" " />
            </div>
        </div>
    )
}

export default Home
